(58, '2024-01-17T02:00:11Z', '#pinoycreepypasta #shadowweavers #aswang\nMake Up Horror Stories | True Horror Stories | Pinoy Creepypasta\n\nBoses Ni - Mallen\n\n\nThis is Shadow Weavers.\n\n\nIn this channel we write and narrate horror stories.\nAlong with our narrations are relaxing scenes of dark and creepy forests.\n\nThe stories that me and our voice actors narrate here are written by me, based on true stories shared to me by my friends and followers.\nI fix the wordings and finalize the script to be more appealing to my audience before presenting the narration.\nI also have writers for the casual fiction story segments.\nAll the stories narrated here are exclusive for this channel alone.\n\n\nThe narrations and voiceovers are all done by me and our voice actors.\n\n\nThe visuals that go along with the narrations are created from scratch using a 3D modeling software.\nIt is then edited on filmora for a few more added effects.\n\n\n\n\nThe stories that we narrate are spoken in the Tagalog language.\nEach of my episode consists of different stories and they are never repeated not even once.\n\n\nSummary\n\n\n-The stories are written and finalized by me.\n-I do all the narrations along with my voice actors and never have I used any automated voice. Everything is voice by us.\n-Visuals are done exclusively for this channel.\n-Stories, Narratives, and Visuals are done and edited by me.\n\nRelated Channel\nPinoy Creepypasta - TagalogHorrorStories\n\nRecently Uploaded\nFrom Shadow Weavers - Tagalog Horror Stories\nTV at Radyo Horror Stories | True Horror Stories | Pinoy Creepypasta\n\n\nEQUIPMENTS USED\n\n\n[Video Editing]\nAMD Ryzen‚Ñ¢ 7 5800X 3.8GHz Up to 4.7GHz\nMemory 16GB DDR4 \nMSI B550M PRO-VDH WIFI\nCoolermaster Hyper 212 ARGB\nGeForce¬Æ GTX 1050 Ti\nKINGSTON 250GB NV1 M.2 SSD\nACEPOWER 650W BRONZE SEMI MOD\nGAMING KEYBOARD & MOUSE\n21.5\" LED WIDESCREEN MONITOR \n\n\n\n\n[Microphone for the narrations]\nBM-800 Mic Professional USB Condenser Studio Recording Microphone (old uploads)\nAudio Technica - ATR2500x USB Cardioid Condenser Microphone Condenser Microphone (latest uploads)\n\n\n[Editing Software]\n\n\nAudacity - (Audio Editing)\nWondershare Filmora - (Video Editing)'),
