(76, '2019-03-23T09:00:03Z', 'Das meiste von Susis Schminkzeug ist verschwunden! Sie ist sich ziemlich sicher, dass es entweder ihr Schleimfreund Sam oder ihre j√ºngere Schwester Martina gewesen sein muss. Aber keiner von beiden w√ºrde das zugeben. Ein paar Schminksachen sind noch da und so beschlie√üt Susi, es dort zu verstecken, wo Sam und Martina es nie suchen w√ºrden ‚Äì in Obst! Hier findest du ein paar wirklich schlaue und lustige Ideen, um deine Schminksachen zu versch√∂nern oder einen Freund zu veralbern. Oder beides!\n\nSusi stellt 6 Make-up-Fr√ºchte her.\n\n01:14 Als erstes tarnt sie ihre fl√ºssige Foundation in einem Granatapfel. Daf√ºr benutzt sie einen Styroporball und Filz. Au√üerdem verwendet sie rote Halbperlen als Granatapfelkerne. Das sieht wirklich total echt aus.\n\n04:37 Als n√§chstes versteckt sie ihren Lipgloss mit Coca-Cola-Geschmack in einer k√ºnstlichen Banane. Die Banane wird einfach ein bisschen ausgeh√∂hlt und der Lipgloss wird hineingeklebt. Ein bisschen gelbe Acrylfarbe verdeckt das wei√üe Styropor in der Banane.\n\n06:20 Susis Mascara verschwindet einfach in einer Sternfrucht! F√ºr diese Bastelei ben√∂tigt man eine Menge gelben Hei√ükleber. F√ºnf Klebesticks sorgen f√ºr die Stern-Form und noch mehr Kleber sorgt f√ºr das n√∂tige Volumen. Tupfe ein wenig Acrylfarbe auf die R√§nder, damit deine Sternfrucht noch echter aussieht.\n\n08:27 Hast du eine Idee, wie du dein Puder h√ºbsch verpacken kannst? Mache eine Orange daraus! Daf√ºr brauchst du nur einen Styroporball und Acrylfarbe. Klebe deine Puderdose zwischen die zwei H√§lften des Balls und male sie orange an!\n\n10:40 Wer mag keine Ananas? Naja, manche Leute m√∂gen sie nicht. Aber Susi verwandelt ihren Make-up-Entferner in eine saftige Ananas. Als Grundlage benutzt sie Alufolie und klebt dann gelben und gr√ºnen Filz drauf. Es dauert eine Weile, aber das Ergebnis ist zauberhaft!\n\n13:25 Was machen wir blo√ü mit den ganzen Styropork√ºgelchen, die beim Basteln √ºbrig geblieben sind? Klebe sie auf einen EOS Lippen Balsam, dass er wie eine Litschi aussieht! Vergiss nicht ihn pink anzumalen!\n\nDiese Frucht-Schminksachen sehen wie ein richtiger Obstkorb aus. Susi konnte damit sogar Schlauschleim Sam t√§uschen!\n\nAbonniere Sams Kanal und gib ihm ein \"Daumen hoch\", damit er motiviert wird, weitere Videos f√ºr Dich zu drehen! \nhttps://bit.ly/2yqswmw\n\nVerwendetes Material: https://www.depositphotos.com\n\nMusik von Epidemic Sound: https://www.epidemicsound.com/\n\nOPENING THEME\nTitle: Cuckoo\nSource: https://audiojungle.net/item/cuckoo/20801073'),
